import React from 'react';
import GoogleMapReact from 'google-map-react';

const MapOutMarker = ({ text }) => <div>{text}</div>;

class MapOutput extends React.Component {

    render() { 

        return (

            <>

                <div className="w-full h-[350px]">
                    <GoogleMapReact
                        bootstrapURLKeys={{ key: window.ogSettings.og_gmaps_api_key }}
                        defaultCenter={{ lat: Number(this.props.latitude), lng: Number(this.props.longitude) }}
                        defaultZoom={19}
                    >
                        <MapOutMarker lat={Number(this.props.latitude)} lng={ Number(this.props.longitude) } text="My Marker" />
                    </GoogleMapReact>
                </div>

            </>
        )

    }

}

export default MapOutput;
